import React from 'react';
import './Projects.css';

const Projects = () => {
  const projects = [
    {
      title: 'SubjECTive-QA Dataset',
      category: 'NLP Research',
      tech: ['Python', 'NLP', 'Machine Learning'],
      description: 'Contributed to NeurIPS dataset for subjective question answering, advancing the field of contextual language understanding.',
      link: 'https://arxiv.org/abs/2410.20651'
    },
    {
      title: 'World Central Banks',
      category: 'Financial Data Platform',
      tech: ['Web Development', 'Financial Data', 'Analytics'],
      description: 'Comprehensive platform for analyzing and visualizing global central bank data and monetary policies.',
      link: 'https://gcb-web-bb21b.web.app/'
    },
    {
      title: 'Language Modeling for the Future of Finance: A Quantitative Survey',
      category: 'NLP Research',
      tech: ['NLP', 'Finance', 'Survey Research'],
      description: 'Comprehensive survey of 374 NLP research papers examining the application of language modeling techniques to financial problems and decision-making.',
      link: 'https://arxiv.org/abs/2504.07274'
    },
    {
      title: 'S1 Filings Parsing',
      category: 'Financial Data Processing',
      tech: ['Python', 'NLP', 'SEC Filings'],
      description: 'Advanced parsing system for extracting and analyzing structured data from S1 SEC filings using natural language processing techniques.',
      link: '#'
    },
    {
      title: 'Financial Video Captioning',
      category: 'Multimodal AI',
      tech: ['Computer Vision', 'NLP', 'Deep Learning'],
      description: 'Automated system for generating accurate captions and transcripts for financial video content using multimodal AI approaches.',
      link: '#'
    },
    {
      title: 'Backtrading Engine with Stress Testing',
      category: 'Algorithmic Trading',
      tech: ['Python', 'Backtesting', 'Risk Management'],
      description: 'Advanced backtesting engine incorporating comprehensive stress testing capabilities for robust trading strategy evaluation.',
      link: '#'
    },
    {
      title: 'FIdent: Differential Equations',
      category: 'Mathematical Modeling',
      tech: ['Mathematical Modeling', 'Python'],
      description: 'Research on differential equation identification and solving using computational methods.',
      link: '#'
    },
    {
      title: 'Mutual Fund Attribution Model',
      category: 'Financial Analysis',
      tech: ['Finance', 'Data Analysis', 'Python'],
      description: 'Developed attribution models for analyzing mutual fund performance and risk factors.',
      link: '#'
    }
  ];

  return (
    <section id="projects" className="projects">
      <div className="container">
        <div className="projects-header">
          <h2 className="section-title">Projects & Research</h2>
          <p className="section-subtitle">Computational mathematical engineering portfolio</p>
        </div>

        <div className="projects-grid">
          {projects.map((project, index) => (
            <div key={index} className="project-card">
              <div className="project-content">
                <h3 className="project-title">{project.title}</h3>
                <p className="project-category">{project.category}</p>
                <p className="project-description">{project.description}</p>

                <div className="project-tech">
                  {project.tech.map((tech, techIndex) => (
                    <span key={techIndex} className="tech-tag">{tech}</span>
                  ))}
                </div>

                {(project.link && project.link !== '#') && (
                  <a href={project.link} className="project-link" target="_blank" rel="noopener noreferrer">
                    View Project →
                  </a>
                )}
              </div>
            </div>
          ))}
        </div>
      </div>
    </section>
  );
};

export default Projects;
